import css from './Health.module.css'

export function Health({data}){
        if(data.color){
            return
            <div style={{background:data.color}} className={css.Card}>
            {data.title}
        </div>
        }else{
            return <div style={{backgroundImage:`url(${data.berry})`}} className={css.Card}>
            {data.title}
        </div>
        }



}
